import React from "react";
import "./App.css";
import * as data from "./data.json";
import * as moment from "moment";

const advice = {
  Drizzle: "Better take an umbrella with you!",
  Clear: "Clear sky, clear mind",
};

function Card(props) {
  return <div className={"card"}>{props.children}</div>;
}

function WeatherDisplay({ date, description, temperature }) {
  return (
    <div>
      <p>Today</p>
      <p>{date.format("MMM Do YYYY")}</p>
      <p>{description}</p>
      <p>{temperature}</p>
      <p>{advice[description]}</p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Card>
          {" "}
          Some Card
          <WeatherDisplay
            date={moment()}
            description={data.weather[0].main}
            temperature={data.main.temp}
          />
        </Card>
      </header>
    </div>
  );
}

export default App;
